// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "./IBEP20.sol";
import "./IMarketplace.sol";
import "./SafeMath.sol";
import "./Ownable.sol";
import "./ERC721.sol";
import "./ERC721Pausable.sol";
import "./EnumerableSet.sol";
import "./EnumerableMap.sol";
import "./IRobotCore.sol";
import "./ReentrancyGuard.sol";

contract RobotCore is Ownable, ERC721Pausable, IRobotCore, ReentrancyGuard {
    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.UintSet;
    using EnumerableMap for EnumerableMap.UintToAddressMap;

    struct Robot {
        uint256 robotId; // id of the robot
        Rarity rarity;
        RobotType robotType;
        uint256[] pieces;
        uint64 birthTime; // The timestamp from the block when this Robot came into existence.
    }

    enum Rarity {
        E,
        D,
        C,
        B,
        A,
        S
    }

    enum RobotType {
        Tank,
        Stealth,
        Basic
    }

    enum PackageType {
        Default,
        First,
        Second,
        Third
    }

    /*** STORAGE ***/
    /// @dev An array containing the Robot struct for all robots in existence. The ID
    ///  of each Robot is actually an index into this array.
    Robot[] robots;

    event MintedRobotFromBundle(address from, uint256[] robotIds, uint256 date);

    uint256 private nextRobotTokenId = 1;
    uint256 private robotPrice = 5 * 10**18; // to review
    uint256 private randNonce;
    uint256 private attachPrice = 3 * 10**18;

    mapping(Rarity => uint8) private _baseRarityPercentage;
    mapping(Rarity => uint8) private _box2RarityPercentage;
    mapping(Rarity => uint8) private _box3RarityPercentage;

    mapping(uint256 => EnumerableSet.UintSet) private _robotPiecesId;

    /* SETTABLE VARIABLES */
    address public _mekaDeployerAddress;
    bool public _mekaDeployerEnabled;
    address public _robotPackageAddress;
    bool public isBurn;
    bool public isRobotFactoryOpen;
    address public _marketplaceAddr;
    address public _mekaAddress;

    constructor(address _mekaToken) ERC721("Mekabot", "Mekabot") {
        isBurn = true;
        _mekaAddress = _mekaToken;
        isRobotFactoryOpen = true;

        _baseRarityPercentage[Rarity.E] = 49;
        _baseRarityPercentage[Rarity.D] = 69;
        _baseRarityPercentage[Rarity.C] = 84;
        _baseRarityPercentage[Rarity.B] = 94;
        _baseRarityPercentage[Rarity.A] = 98;
        _baseRarityPercentage[Rarity.S] = 99;

        _box2RarityPercentage[Rarity.C] = 69;
        _box2RarityPercentage[Rarity.B] = 89;
        _box2RarityPercentage[Rarity.A] = 96;
        _box2RarityPercentage[Rarity.S] = 99;

        _box3RarityPercentage[Rarity.B] = 64;
        _box3RarityPercentage[Rarity.A] = 93;
        _box3RarityPercentage[Rarity.S] = 99;
    }

    function setBaseRarity(Rarity rarity, uint8 percentage) external onlyOwner {
        _baseRarityPercentage[rarity] = percentage;
    }

    function setBox2Rarity(Rarity rarity, uint8 percentage) external onlyOwner {
        _box2RarityPercentage[rarity] = percentage;
    }

    function setBox3Rarity(Rarity rarity, uint8 percentage) external onlyOwner {
        _box3RarityPercentage[rarity] = percentage;
    }

    function setMarketplaceAddress(address _address) external onlyOwner {
        _marketplaceAddr = _address;
    }

    function setRobotPackageAddress(address _address) external onlyOwner {
        _robotPackageAddress = _address;
    }

    function setMekaDeployerAddress(address _mekaDeployAddr)
        external
        onlyOwner
    {
        _mekaDeployerAddress = _mekaDeployAddr;
    }

    function setMekaDeployerEnabled() external onlyOwner {
        _mekaDeployerEnabled = !_mekaDeployerEnabled;
    }

    function setRobotPrice(uint256 _price) external onlyOwner {
        robotPrice = _price;
    }

    function setTokenAddress(address _addr) external onlyOwner {
        _mekaAddress = _addr;
    }

    function setTokenURI(uint256 tokenId, string memory _tokenURI)
        external
        onlyOwner
    {
        _setTokenURI(tokenId, _tokenURI);
    }

    function updateIsBurn() external onlyOwner {
        isBurn = !isBurn;
    }

    function updateRobotFactory() external onlyOwner {
        isRobotFactoryOpen = !isRobotFactoryOpen;
    }

    modifier onlyBundle() {
        require(msg.sender == _robotPackageAddress, "not bundle");
        _;
    }

    modifier robotFactory() {
        require(isRobotFactoryOpen, "robot factory closed");
        _;
    }

    modifier onlyMekaDeploy() {
        if (_mekaDeployerEnabled) {
            require(msg.sender == _mekaDeployerAddress, "not mekadeploy");
            _;
        } else {
            _;
        }
    }

    function withdrawBalance() external onlyOwner {
        IBEP20(_mekaAddress).transfer(owner(), getBalance());
    }

    function withdrawBnb() external onlyOwner {
        uint256 amount = address(this).balance;

        (bool success, ) = payable(owner()).call{value: amount}("");
        require(success, "Failed to send Ether");
    }

    function _mintRobot(
        address to,
        uint256 tokenId,
        Rarity rarity
    ) private {
        require(to != address(0), "ERC721: mint to the zero address");
        require(!_exists(tokenId), "ERC721: token already minted");

        Robot memory _robot = Robot({
            robotId: tokenId,
            rarity: rarity,
            robotType: RobotType(random(3)),
            pieces: new uint256[](5),
            birthTime: uint64(block.timestamp)
        });

        robots.push(_robot);

        _safeMint(to, tokenId, "");

        emit Birth(to, tokenId, block.timestamp);

        emit Transfer(address(0), to, tokenId);
    }

    function attachPiece(
        address _owner,
        uint256 _robotId,
        uint256 _pieceId,
        uint256 _amount
    ) external onlyMekaDeploy robotFactory {
        require(_amount >= attachPrice, "amount too low");
        require(tx.origin == ownerOf(_robotId), "not robot owner");
        require(_robotPiecesId[_robotId].length() < 5, "no slots available");
        require(
            IBEP20(_mekaAddress).transferFrom(_owner, address(this), _amount)
        );

        Robot storage bot = robots[_robotId - 1];
        _robotPiecesId[_robotId].add(_pieceId);
        bot.pieces[_robotPiecesId[_robotId].length() - 1] = _pieceId;
    }

    function createRobot(
        address _owner,
        uint256 _amount,
        string memory tokenURI
    ) external onlyMekaDeploy robotFactory {
        require(_amount >= robotPrice, "INVALID AMOUNT");
        require(
            IBEP20(_mekaAddress).transferFrom(_owner, address(this), _amount)
        );

        uint256 tokenId = nextRobotTokenId;

        _mintRobot(_owner, tokenId, randomizeBaseRarity());
        _setTokenURI(tokenId, tokenURI);

        nextRobotTokenId++;
    }

    function createSale(uint256 _tokenId, uint256 _startingPrice)
        external
        whenNotPaused
    {
        require(msg.sender == ownerOf(_tokenId), "Not tokenId owner");

        _approve(_marketplaceAddr, _tokenId);
        IMarketplace(_marketplaceAddr).createSale(
            _tokenId,
            0,
            address(0),
            _startingPrice,
            msg.sender
        );
    }

    function burnRobot(uint256 _tokenId) external robotFactory {
        require(isBurn == true, "Burning is not allowed");
        require(msg.sender == ownerOf(_tokenId), "Not tokenId owner");

        _burn(_tokenId); // burn token
    }

    /// @notice Returns all the relevant information about a specific Robot.
    /// @param _id The ID of the Robot of interest.
    function getRobot(uint256 _id) external view returns (Robot memory robot) {
        return robots[_id - 1];
    }

    function getBalance() public view returns (uint256) {
        return IBEP20(_mekaAddress).balanceOf(address(this));
    }

    function pause() public whenNotPaused onlyOwner {
        _pause();
    }

    function unpause() public whenPaused onlyOwner {
        _unpause();
    }

    function createRobotFromBundle(
        address _owner,
        uint8 packageType,
        uint8 robotQuantity
    ) external onlyBundle robotFactory {
        PackageType pkgType = PackageType(packageType);

        uint256[] memory allTokens = new uint256[](robotQuantity);

        if (pkgType == PackageType.First) {
            allTokens[0] = nextRobotTokenId;
            _mintRobot(_owner, nextRobotTokenId, randomizeBaseRarity());
            nextRobotTokenId++;
        } else if (pkgType == PackageType.Second) {
            for (uint256 index = 0; index < robotQuantity; index++) {
                allTokens[index] = nextRobotTokenId;
                _mintRobot(_owner, nextRobotTokenId, randomizeBox2Rarity());
                nextRobotTokenId++;
            }
        } else {
            for (uint256 index = 0; index < robotQuantity; index++) {
                allTokens[index] = nextRobotTokenId;
                _mintRobot(_owner, nextRobotTokenId, randomizeBox3Rarity());
                nextRobotTokenId++;
            }
        }

        emit MintedRobotFromBundle(_owner, allTokens, block.timestamp);
    }

    function random(uint8 _modulus) private returns (uint256) {
        randNonce++;
        return
            uint256(
                keccak256(
                    abi.encodePacked(block.difficulty, msg.sender, randNonce)
                )
            ) % _modulus;
    }

    function randomizeBaseRarity() private returns (Rarity) {
        uint256 randNumber = random(100);

        if (randNumber <= _baseRarityPercentage[Rarity.E]) {
            return Rarity.E;
        } else if (randNumber <= _baseRarityPercentage[Rarity.D]) {
            return Rarity.D;
        } else if (randNumber <= _baseRarityPercentage[Rarity.C]) {
            return Rarity.C;
        } else if (randNumber <= _baseRarityPercentage[Rarity.B]) {
            return Rarity.B;
        } else if (randNumber <= _baseRarityPercentage[Rarity.A]) {
            return Rarity.A;
        } else {
            return Rarity.S;
        }
    }

    function randomizeBox2Rarity() private returns (Rarity) {
        uint256 randNumber = random(100);

        if (randNumber <= _box2RarityPercentage[Rarity.C]) {
            return Rarity.C;
        } else if (randNumber <= _box2RarityPercentage[Rarity.B]) {
            return Rarity.B;
        } else if (randNumber <= _box2RarityPercentage[Rarity.A]) {
            return Rarity.A;
        } else {
            return Rarity.S;
        }
    }

    function randomizeBox3Rarity() private returns (Rarity) {
        uint256 randNumber = random(100);

        if (randNumber <= _box3RarityPercentage[Rarity.B]) {
            return Rarity.B;
        } else if (randNumber <= _box3RarityPercentage[Rarity.A]) {
            return Rarity.A;
        } else {
            return Rarity.S;
        }
    }
}
